import React from 'react';
// import 'bootstrap/dist/css/bootstrap.css';
import { BrowserRouter, Switch, Route} from "react-router-dom";


import Home from "./pages/Home";

function App() {

  return (
    <BrowserRouter>

        <Switch>

          <Route path='/'> <Home/> </Route>

          {/* <Route exact component={NotFound}/> */}
          </Switch>

    </BrowserRouter>
  );
}

export default App;
